import React from 'react'
import web from '../src/Images/web.avif'
import app from '../src/Images/app.avif'
import software from "../src/Images/software.avif";
import digital from "../src/Images/digital.avif";
import android from "../src/Images/android.avif";
import marketing from "../src/Images/marketing.avif";
const Sdata = [
  {
    title: "Web Development",
    imgsrc: web,
  },
  {
    title: "App Development",
    imgsrc: app,
  },
  {
    title: "Software Development",
    imgsrc: software,
  },
  {
    title: "Digital Marketing",
    imgsrc: digital,
  },
  {
    title: "Android Development",
    imgsrc: android,
  },
  {
    title: "Marketing",
    imgsrc: marketing,
  },
];

export default Sdata
